import styled from 'styled-components';

export const ProfileStyle = styled.div`
    margin : 40px 0 0;
`

export const PostCardWrapper = styled.div`
    margin : 20px 0 40px;
`

export const UserCardWrapper = styled.div`
    margin : 20px 0 0px;
`
